import React, { useEffect, useState } from "react";
import api from "../api";
import "./servicesPage.css";

function ServicesPage() {
  const [services, setServices] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  // Add service form
  const [name, setName] = useState("");
  const [category, setCategory] = useState("");
  const [price, setPrice] = useState("");
  const [formError, setFormError] = useState("");

  // Editing state
  const [editingId, setEditingId] = useState(null);
  const [editName, setEditName] = useState("");
  const [editCategory, setEditCategory] = useState("");
  const [editPrice, setEditPrice] = useState("");
  const [savingEdit, setSavingEdit] = useState(false);

  const loadServices = async () => {
    try {
      setLoading(true);
      setError("");
      const res = await api.get("/services");
      setServices(res.data);
    } catch (err) {
      console.error("Error loading services:", err);
      setError("Failed to load services.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadServices();
  }, []);

  const handleAddService = async (e) => {
    e.preventDefault();
    setFormError("");

    if (!name.trim() || price === "") {
      setFormError("Name and price are required.");
      return;
    }

    try {
      await api.post("/services", {
        name: name.trim(),
        category: category.trim(),
        price: Number(price),
      });

      setName("");
      setCategory("");
      setPrice("");
      loadServices();
    } catch (err) {
      console.error("Error adding service:", err);
      setFormError("Failed to add service. Please try again.");
    }
  };

  const startEdit = (service) => {
    setEditingId(service._id);
    setEditName(service.name);
    setEditCategory(service.category || "");
    setEditPrice(service.price);
  };

  const cancelEdit = () => {
    setEditingId(null);
    setEditName("");
    setEditCategory("");
    setEditPrice("");
  };

  const handleSaveEdit = async (id) => {
    if (!editName.trim() || editPrice === "") {
      alert("Name and price are required.");
      return;
    }

    try {
      setSavingEdit(true);
      await api.put(`/services/${id}`, {
        name: editName.trim(),
        category: editCategory.trim(),
        price: Number(editPrice),
      });
      cancelEdit();
      loadServices();
    } catch (err) {
      console.error("Error updating service:", err);
      alert("Failed to update service.");
    } finally {
      setSavingEdit(false);
    }
  };

  const handleToggleStatus = async (id, currentStatus) => {
    const action = currentStatus ? "Deactivate" : "Activate";
    if (!window.confirm(`Are you sure you want to ${action} this service?`)) return;

    try {
      await api.put(`/services/toggle/${id}`);
      loadServices();
    } catch (err) {
      console.error("Error toggling service:", err);
      alert("Failed to update service status.");
    }
  };

  return (
    <div className="services-container">
      
      <div className="page-header">
        <h2 className="page-title">Service Menu</h2>
        <p className="page-subtitle">Manage your salon services and pricing</p>
      </div>

      {/* ADD SERVICE CARD */}
      <div className="card add-service-card">
        <div className="add-service-header">
          <h3>✨ Add New Service</h3>
        </div>

        {formError && <div className="error-text">{formError}</div>}

        <form onSubmit={handleAddService} className="service-form">
          <input
            type="text"
            className="modern-input"
            placeholder="Service Name (e.g. Haircut)"
            value={name}
            onChange={(e) => setName(e.target.value)}
          />

          <input
            type="text"
            className="modern-input"
            placeholder="Category (e.g. Hair)"
            value={category}
            onChange={(e) => setCategory(e.target.value)}
          />

          <input
            type="number"
            min="0"
            className="modern-input"
            placeholder="Price ₹"
            value={price}
            onChange={(e) => setPrice(e.target.value)}
          />

          <button type="submit" className="btn-primary">
            + Add Service
          </button>
        </form>
      </div>

      {/* SERVICES TABLE CARD */}
      <div className="card services-table-card">
        {loading && <div className="muted">Loading services...</div>}
        {error && <div className="error-text">{error}</div>}

        {!loading && services.length === 0 && (
          <div className="muted">No services found. Add your first service above!</div>
        )}

        {!loading && services.length > 0 && (
          <table className="services-table">
            <thead>
              <tr>
                <th style={{ width: '40%' }}>Name</th>
                <th style={{ width: '25%' }}>Category</th>
                <th className="right" style={{ width: '15%' }}>Price</th>
                <th className="center" style={{ width: '20%' }}>Actions</th>
              </tr>
            </thead>

            <tbody>
              {services.map((s) => (
                <tr 
                  key={s._id} 
                  className={!s.isActive ? "inactive-row" : ""}
                >
                  {/* NAME COLUMN */}
                  <td>
                    {editingId === s._id ? (
                      <input
                        className="edit-input"
                        value={editName}
                        onChange={(e) => setEditName(e.target.value)}
                        autoFocus
                      />
                    ) : (
                      <span>
                        {s.name} 
                        {!s.isActive && <span className="badge">Inactive</span>}
                      </span>
                    )}
                  </td>

                  {/* CATEGORY COLUMN */}
                  <td>
                    {editingId === s._id ? (
                      <input
                        className="edit-input"
                        value={editCategory}
                        onChange={(e) => setEditCategory(e.target.value)}
                      />
                    ) : (
                      s.category || "—"
                    )}
                  </td>

                  {/* PRICE COLUMN */}
                  <td className="right">
                    {editingId === s._id ? (
                      <input
                        type="number"
                        className="edit-input"
                        value={editPrice}
                        onChange={(e) => setEditPrice(e.target.value)}
                        style={{ textAlign: 'right' }}
                      />
                    ) : (
                      <strong>₹{s.price}</strong>
                    )}
                  </td>

                  {/* ACTIONS COLUMN */}
                  <td className="center">
                    <div className="action-group">
                      {editingId === s._id ? (
                        <>
                          <button
                            className="btn-action btn-save"
                            onClick={() => handleSaveEdit(s._id)}
                            disabled={savingEdit}
                          >
                            {savingEdit ? "..." : "Save"}
                          </button>
                          <button
                            className="btn-action btn-cancel"
                            onClick={cancelEdit}
                          >
                            Cancel
                          </button>
                        </>
                      ) : (
                        <>
                          <button
                            className="btn-action btn-edit"
                            onClick={() => startEdit(s)}
                          >
                            Edit
                          </button>

                          <button
                            className={`btn-action ${s.isActive ? "btn-deactivate" : "btn-activate"}`}
                            onClick={() => handleToggleStatus(s._id, s.isActive)}
                          >
                            {s.isActive ? "Deactivate" : "Activate"}
                          </button>
                        </>
                      )}
                    </div>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
}

export default ServicesPage;
